import './App.css';

import { Link } from "react-router-dom";
function Home(){
  return<div>Home</div>;
}

function About(){
  return<div>About</div>;
}
function App() {
  return (
    <div class="App.js">
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
    </div>
  );
}

export default App;
